import React from 'react';
// import './styles/header.css'
class Header extends React.Component{

    render(){
        return(
            <React.Fragment>
                <header className="header">
                    <div>
                        <div>{"logo"}</div>
                        <div>{"input"}</div>
                        <div>{"carrito"}</div>
                    </div>
                </header>
            </React.Fragment>
        )
    }

} 
export default Header;
